import React, { useEffect, useState } from 'react';
//import { Link, withRouter } from 'react-router-dom';
import { getNyc } from '../actions/getNyc';
import { getGaurdian } from '../actions/getGaurdian';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import DataCard from './DataCard';

// create initialState and pass in
// make func  filter results with arg and arr
// sub arg for nyc references
// call filter results from setResults
// call filter with nyc and gaur

const DataView = ({ getNyc, getGaurdian, nyc }) => {
	useEffect(() => {
		getNyc();
		getGaurdian();
	}, [getNyc]);

	const intialState = { nycResults: [] };

	const [nycResults, setResults] = useState([nycResults]);

	const results = arr => {
		setResults([
			...nycResults,
			{
				id: arr.length,
				arr: arr.push(value)
			}
		]);
	};

	if (typeof arr === undefined) {
		return;
	} else if (arr.hasOwnProperty('nyc')) {
		Object.entries(arr.arr).map(([key, value]) => {
			setResults(nycResults, value);
		});
	}

	results(nycResults);

	return <DataCard results={nycResults} />;
};

DataView.propTypes = {
	getNyc: PropTypes.func.isRequired,
	getGaurdian: PropTypes.func.isRequired,
	nyc: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
	nyc: state.nyc
	//: state.gaurdian.gaurdianData
});

export default connect(mapStateToProps, { getNyc, getGaurdian })(DataView);
